import time

def maxNum(l):
	i=0
	count=1
	maxx=0
	while(i<len(l)-1):
		if(l[i]==l[i+1]):
			count+=1
			i+=1
			continue
		if(count>maxx):
			maxx=count
			index=i-1
		count=1
		i+=1
	if(count>maxx):
		print(l[i-1])
		return(l[i-1])
	else:
		print(l[index])
		return(l[index])


